import { useState } from "react";

const Delete = (props) => {
  const [data, setData] = useState(props);

  fetch("/borrar_producto/"),
    {
      method: "DELETE",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    }
      .then(function (res) {
        return res.json();
      })
      .then(function (datos) {
        console.log(datos);
        alert("PRODUCTO ELIMINADO CON ÉXITO");
      });

  return (
    <div>
      <button
        className="btn_sup"
        type="submit"
        onClick={() => {
          setData(props);
        }}
      >
        Supprimier
      </button>
    </div>
  );
};

export default Delete;
